(() => {
    // Funktion, um UTM-Parameter aus der URL zu holen
    function getUTMParams() {
        const urlParams = new URLSearchParams(window.location.search);
        const utmParams = {};

        // Prüfe alle relevanten UTM-Parameter
        ['utm_source', 'utm_medium', 'utm_campaign', 'utm_term', 'utm_content', 'hsa_ad', 'hsa_cam', 'hsa_grp', 'campaign_id', 'add_id_1', 'add_id_2', 'account_id'].forEach(param => {
            if (urlParams.has(param)) {
                utmParams[param] = urlParams.get(param);
            }
        });

        // Debug: Zeige die UTM-Parameter im Konsolen-Log an
        console.log('UTM-Parameter:', utmParams);

        return utmParams;
    }

    // Funktion, um den Button-Link mit UTM-Parametern zu aktualisieren
    function updateButtonLink() {
        const utmParams = getUTMParams();
        const utmQueryString = new URLSearchParams(utmParams).toString();

        // Debug: Zeige die generierte Query-String im Konsolen-Log an
        console.log('UTM Query-String:', utmQueryString);

        if (utmQueryString) {
            // Finde das a-Tag (den Button) basierend auf der Klasse und aktualisiere den href
            const button = document.querySelector('.button-copy.w-button');
            
            // Debug: Überprüfe, ob der Button gefunden wurde
            if (button) {
                console.log('Button gefunden:', button);
                const baseUrl = button.getAttribute('href').split('?')[0]; // Entferne bestehende Query-Parameter
                button.setAttribute('href', `${baseUrl}?${utmQueryString}`); // Füge die neuen UTM-Parameter hinzu

                // Debug: Zeige den aktualisierten href-Wert des Buttons an
                console.log('Neuer Button href:', button.getAttribute('href'));
            } else {
                console.error('Button nicht gefunden. Überprüfe den Selektor.');
            }
        }
    }

    // Neue Funktion, um automatisch auf eine Seite weiterzuleiten und UTM-Parameter zu übergeben
    function redirectWithUTM(targetUrl) {
        const utmParams = getUTMParams();
        const utmQueryString = new URLSearchParams(utmParams).toString();

        if (utmQueryString) {
            // Debug: Zeige die Weiterleitungs-URL im Konsolen-Log an
            console.log('Weiterleitung an URL:', `${targetUrl}?${utmQueryString}`);

            // Weiterleitung zur neuen Seite mit den UTM-Parametern
            window.location.href = `${targetUrl}?${utmQueryString}`;
        } else {
            console.error('Keine UTM-Parameter gefunden.');
        }
    }

    // Event Listener hinzufügen, um den Button-Link zu aktualisieren, wenn die Seite geladen ist
    document.addEventListener('DOMContentLoaded', function() {
        updateButtonLink();

        // Automatische Weiterleitung zu einer spezifischen Seite
        // Hier kannst du die Ziel-URL anpassen, z.B. für /geschaftsfuhrer-call oder /head-of-sales-call
        const targetUrl = '/geschaftsfuhrer-call'; // Beispielhafte Ziel-URL, die du anpassen kannst
        redirectWithUTM(targetUrl);
    });
})();


